@kayali Vanilla Candy Rock Sugar | 42 🍭🍬
I’ve worn this perfume everyday since it arrived on Monday. I find that it smells a lot sweeter than Vanilla | 28. Vanilla | 28 was my go-to during winter & can’t wait to layer it with the other Kayali scents in my collection.
Curious how this playful, creamy scent will translate once the weather warms up! #kayali #vanilla #vanillacandyrocksugar #perfume #fragrance #playful #soft #fragrances #scent #scents

